INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASTE', 'STOCK', 'Astec Industries, Inc.', 'NMS', 'Industrials', 'Farm & Heavy Construction Machinery', 'Astec Industries, Inc. is a manufacturer of specialized equipment for asphalt road building, aggregate processing and concrete production. The Companys manufacturing operations are divided into two business segments: Infrastructure Solutions and Materials Solutions. The Infrastructure Solutions segment designs, engineers, manufactures and markets a complete line of asphalt plants, concrete plants and their related components and ancillary equipment, including industrial automation controls and telematics platforms, as well as asphalt road construction equipment, industrial thermal systems, land clearing, recycling and other heavy equipment. The Materials Solutions segment designs and manufactures heavy rock processing equipment, in addition to servicing and supplying parts for the aggregate, mining, recycling, ports and bulk handling markets. It also operates a line of controls and automation products designed to deliver enhanced productivity through improved equipment performance.', 'Chattanooga, TN, United States', 4148);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APOG', 'STOCK', 'Apogee Enterprises, Inc.', 'NMS', 'Industrials', 'Building Products & Equipment', 'Apogee Enterprises, Inc. is a provider of architectural products and services for enclosing buildings, and high-performance glass and acrylic products used for preservation, energy conservation, and enhanced viewing. Its segments include Architectural Metals, Architectural Services, Architectural Glass and Performance Surfaces. The Architectural Metals segment designs, engineers, fabricates and finishes aluminum window, curtainwall, storefront and entrance systems used primarily in non-residential construction. Architectural Services segment integrates technical services, project management, and field installation services to design, engineer, fabricate, and install architectural curtainwall and other facade-related systems primarily in non-residential construction. The Architectural Glass segment cuts, treats, coats and fabricates high-performance glass used in custom window and wall systems. The Performance Surfaces segment develops and manufactures high-performance coated materials.', 'Minneapolis, MN, United States', 4500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGD', 'STOCK', 'abrdn Global Dynamic Dividend', 'NYQ', NULL, NULL, NULL, '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FINX', 'STOCK', 'Global X FinTech ETF', 'NGM', NULL, NULL, 'The fund invests at least 80% of its total assets in the securities of the underlying index. The underlying index is designed to provide exposure to exchange-listed companies in developed markets that provide financial technology products and services, including companies involved in mobile payments, peer-to-peer (P2P) and marketplace lending, financial analytics software and alternative currencies, as defined by the index provider. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BMGL', 'STOCK', 'Basel Medical Group Ltd', 'NCM', 'Healthcare', 'Medical Care Facilities', 'Basel Medical Group Ltd is a holding company, which operates through its subsidiary, Basel Medical Group Pte. Ltd. It provides a wide spectrum of general and subspecialized orthopedic, trauma and sports medicine services such as knee/hip replacements, sports medicine/surgery, spine surgery, foot/ankle surgery and minimally invasive orthopedic procedures, as well as neurosurgical treatments. Its orthopedic treatments and surgery include non-surgical treatments, such as medications, injections, splinting and physiotherapy, and surgical orthopedic procedures, including minimally invasive treatments for complex surgeries. Its rehabilitative therapy provides in-house physiotherapy treatments, including post-surgery rehabilitation, as well as sports therapy. Its neurosurgical care covers treatments involving spinal and brain conditions, from headaches and brain tumors to spinal issues, aneurysms and strokes. It also specializes in diagnostic imaging and outpatient care.', 'Singapore, , Singapore', 32);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRC', 'STOCK', 'Brady Corporation', 'NYQ', 'Industrials', 'Security & Protection Services', 'Brady Corporation is a global manufacturer and supplier of identification solutions and workplace safety products that identify and protect premises, products and people. It markets, sells and distributes a range of identification and safety products and solutions across product categories: Product identification, Wire identification, Healthcare identification, and People identification. Product identification includes materials, printing systems, radio frequency identification and barcode scanners for product identification, brand protection labeling, and asset tracking labels, among others. Wire identification includes handheld printers, wire markers, sleeves and tags. Healthcare identification includes wristbands, labels, printing systems, and other products used in hospital, laboratory, and other healthcare settings for tracking and improving the safety of patients. People identification includes name tags, badges, lanyards, rigid card printing systems, and access control software.', 'Milwaukee, WI, United States', 5700);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CINT', 'STOCK', 'CI&T Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'CI&T Inc is a Brazil-based holding company. The Company is mainly engaged in the investment, as a partner or shareholder, in other companies, consortia or joint ventures in Brazil, and other countries. The Companys subsidiaries, including CI&T Delaware LLC, Somo Global Ltd (Somo), CI&T Oceania PTY Ltd (CI&T Oceania), among others, are mainly engaged in the development of customizable software through the implementation of software solutions, including machine learning, artificial intelligence (AI), analytics, cloud migration and mobility technologies.', 'Campinas, SP, Brazil', 7399);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTNT', 'STOCK', 'Cheetah Net Supply Chain Service Inc.', 'NCM', 'Industrials', 'Integrated Freight & Logistics', 'Cheetah Net Supply Chain Service Inc. is a logistics and warehousing services provider. The Company is focused on logistics and warehousing services. The logistics and warehousing business focus on providing freight forwarding services for clients shipping goods from the United States to mainland China or Hong Kong. It operates as a non-vessel-operating common carrier (NVOCC), bridging the gap between shippers and ocean carriers to facilitate the movement of cargo. By acting as its customers United States point of contact, it coordinates shipments on their behalf, leveraging its expertise and carrier network to streamline logistics. Its primary responsibilities include cargo storage, freight forwarding, United States customs clearance, and labor services and cargo loading and unloading. The Company provides general labor and container loading and unloading workforce services to clients through TW & EW Services Inc (TWEW).', 'Irvine, CA, United States', 13);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARDC', 'STOCK', 'Ares Dynamic Credit Allocation Fund, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Ares Dynamic Credit Allocation Fund, Inc. is a closed-ended fixed income fund launched by Ares Management LLC. The fund is managed by Ares Capital Management II LLC. It primarily invests in the U.S. securities and companies. The fund primarily invests in debt instruments such as senior loans made primarily to companies whose debt is rated below investment grade, corporate bonds that are primarily high yield issues rated below investment grade, equity securities of CLOs and debt securities issued by CLOs, and other fixed-income instruments. It focuses on such factors as the overall macroeconomic environment, financial markets, and company specific research and analysis, to create its portfolio. Ares Dynamic Credit Allocation Fund, Inc. was formed on November 27, 2012 and is domiciled in the United States..', 'Los Angeles, CA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DFGX', 'STOCK', 'Dimensional Global Ex US Core Fixed Income ETF', 'NGM', NULL, NULL, 'The fund seeks its investment objective by investing primarily in a universe of non-U.S. dollar-denominated foreign and U.S. debt securities. The portfolio manager will purchase fixed income securities that mature within twenty years from the date of settlement. The portfolio manager intends to invest its assets to gain exposure to at least three different countries, excluding the United States.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CREG', 'STOCK', 'Smart Powerr Corp.', 'NCM', 'Utilities', 'Utilities - Renewable', 'Smart Powerr Corp, formerly China Recycling Energy Corporation, is a China-based company principally engaged in the recycling energy business. The Company offers waste energy recycling systems to companies for use in iron and steel, nonferrous metal, cement, coal and petrochemical plants. Its waste pressure-to-energy solution consists of the blast furnace top gas recovery turbine unit (TRT), a system that utilizes high pressure gas emitted from the blast furnace top to drive turbine units and generate electricity. Its waste heat-to-energy solution consists of heat power generation projects for applications in cement, steel, coking coal and nonferrous metal industries, which collect the residual heat from various manufacturing processes, such as the entrance and exit ends of the cement rotary kilns, to generate electricity. Its waste gas-to-energy solution primarily consists of the Waste Gas Power Generation system (WGPG) and the Combined Cycle Power Plant (the CCPP).', 'Xi''an, , China', 14);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGYS', 'STOCK', 'Agilysys, Inc.', 'NMS', 'Technology', 'Software - Application', 'Agilysys, Inc. is a hospitality software company, which is engaged in delivering cloud-native software-as-a-service (SaaS) and on-premises solutions for hotels, resorts, cruise lines, casinos, corporate foodservice management, restaurants, universities, stadiums, and healthcare facilities. The Companys software solutions include point-of-sale (POS), property management (PMS), inventory and procurement, payments, and related applications that manage and enhance the entire guest journey. It operates across North America, Europe, the Middle East, Asia-Pacific, and India. Its food and beverage ecosystem solutions include InfoGenesis, IG Kiosk, IG KDS, IG OnDemand, IG Fly, IG Quick Pay, IG Smart Menu, IG Digital Menu Board, IG PanOptic, eCash, and Analyze. Its hospitality and leisure (H&L) ecosystem solutions include LMS, Versa, and Stay. Its hospitality and leisure (H&L) experience-enhancer solutions include Book, Express Kiosk, Express Mobile, Spa, Golf, and Sales & Catering.', 'Alpharetta, GA, United States', 2200);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSGS', 'STOCK', 'CSG Systems International, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'CSG Systems International, Inc. is a software-as-a-service (SaaS) platform company. The Company provides revenue management, digital monetization, customer experience, and payments solutions. It offers integrated real-time revenue management platforms leveraging public cloud, private cloud, or on-premises deployments to optimize and monetize transactions at every stage of the customer lifecycle. Its products are used in the areas of 5G/internet of things (IOT) monetization, financial services, technology, telecom, field service management, operations support systems/business support systems (OSS/BSS), journey orchestration, journey analytics, customer experience, and integrated payments. It offers operational services encompassing infrastructure management, including hardware, application, and environmental management, and application configuration management, including configuration development, release, and deployment. It also offers solutions in ACH and credit card processing.', 'Englewood, CO, United States', 5800);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EIM', 'STOCK', 'Eaton Vance Municipal Bond Fund', 'ASE', 'Financial Services', 'Asset Management', 'Eaton Vance Municipal Bond Fund is a closed ended fixed income mutual fund launched and managed by Eaton Vance Management. It invests primarily in high grade municipal obligations. The fund''s investment portfolio primarily includes investments in companies operating in the transportation, water and sewer, and electric utilities sectors. It was formerly known as Eaton Vance Insured Municipal Bond Fund. Eaton Vance Municipal Bond Fund was founded in 2002 and is based in Boston, Massachusetts.', 'Boston, MA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DGNX', 'STOCK', 'Diginex Limited', 'NCM', 'Industrials', 'Consulting Services', 'Diginex Ltd is an investment holding company mainly engaged in the software as a service (SaaS) business. The Company operates its businesses through a subsidiary, Diginex Solutions (HK) Limited. Diginex Solutions (HK) Limited is mainly engaged in building end-to-end SaaS solutions for the future of ESG reporting and supply chain due diligence. The Company also provides advisory services to support ESG strategies.', 'London, , United Kingdom', 23);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNF', 'STOCK', 'CNFinance Holdings Limited', 'NYQ', 'Financial Services', 'Mortgage Finance', 'CNFinance Holdings Ltd is a company principally engaged in the provision of home equity loan service. The Company''s primary target borrower segment is micro- and small-enterprise (MSE) owners who own real properties in Tier 1 and Tier 2 cities in China. The Company aims to serve its target borrowers by facilitating home equity loans and providing tailored services.', 'Guangzhou, , China', 691);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COIG', 'STOCK', 'Themes ETF Trust - Leverage Shares 2X Long COIN Daily ETF', 'NGM', NULL, NULL, NULL, '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMMB', 'STOCK', 'Chemomab Therapeutics Ltd.', 'NCM', 'Healthcare', 'Biotechnology', 'Chemomab Therapeutics Ltd, formerly known as Anchiano Therapeutics Ltd, is a Israel-based biopharmaceutical company. The Company specializes in the development of patient oriented targeted therapy for the treatment of a wide range of cancers. Its therapeutic and diagnostic technology, BC-819, constitutes a search paradigm for the targeted destruction of cancer cells with no effect on surrounding tissue and no observed side effects for long-term, safe treatment and prevention of cancer. The patient oriented targeted therapy approach is based on the identification of particular genes that are expressed only in tumors.', 'Tel Aviv, , Israel', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKYI', 'STOCK', 'BIO-key International, Inc.', 'NCM', 'Industrials', 'Security & Protection Services', 'BIO-key International, Inc. is a provider of workforce and customer identity and access management (IAM) solutions featuring passwordless, phoneless and token-less Identity-Bound Biometric (IBB) authentication. The Companys IAM platform enables secure work-from-anywhere for enterprise, education, and government customers using secure multi-factor authentication (MFA). Its products include PortalGuard and PortalGuard Identity-as-a-Service (IDaaS) enterprise IAM, WEB-key biometric civil and large-scale ID infrastructure, MobileAuth mobile phone authentication application for iOS and Android, and quality accessory fingerprint scanner and FIDO-compliant hardware to provide complete solution for identity-innovating customers. Its PortalGuard is a cloud-based identity platform that allows its customers to integrate with any cloud or on-premise SaaS application, service or cloud host, as well as Windows device authentication through a single IAM platform.', 'Holmdel, NJ, United States', 41);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSCX', 'STOCK', 'Invesco Bulletshares 2033 Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment grade corporate bonds with maturities or, in some cases, “effective maturities” in the year 2033. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EJH', 'STOCK', 'E-Home Household Service Holdings Limited', 'NCM', 'Consumer Cyclical', 'Personal Services', 'E-Home Household Service Holdings Ltd is a China-based company principally engaged in the operation of household services through on-line APP platform or call center. The Company operates its businesses through three segments. Installation and Maintenance Services segment mainly provides technical home installation and repair, maintenance and other after sale services. Housekeeping Services segment provides housecleaning, nanny service, maternity matron and personnel staffing services. Senior Care Services segment provides blood pressure monitoring, heart rate analytics, daily steps count, location and track record services through the Companys E-watch, call for help through WeChat or phone, and other care services rendered to senior customers through an E-watch, which is provided to customers when they pay the annual fees.', 'Fuzhou, , China', 526);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRAG', 'STOCK', 'Bragg Gaming Group Inc.', 'NMS', 'Consumer Cyclical', 'Gambling', 'Bragg Gaming Group Inc. is an iGaming content and platform technology solutions provider serving online and land-based gaming operators with its proprietary, content, and cutting-edge player account management (PAM) technology. Its suite of iGaming content and technology, commercial relationships and operational licenses allows it to offer a complete gaming solution in regulated online gaming markets globally. Its PAM platform provides the tools required to operate an online gaming business, including player engagement and data analysis software. Its Bragg Studios offers crafted casino game titles from in-house brands, including Wild Streak Gaming, Atomic Slot Lab and Indigo Magic. Its proprietary content portfolio is complemented by a selection of titles from carefully selected studio partners under the Powered By Bragg program. Games built on Braggs remote games server technology are distributed via the Bragg HUB content delivery platform and are available to Bragg customers.', 'Toronto, ON, Canada', 514);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DMLP', 'STOCK', 'Dorchester Minerals, L.P.', 'NMS', 'Energy', 'Oil & Gas E&P', 'Dorchester Minerals, L.P. engages in the acquisition, ownership, and administration of royalty properties in the United States. Its royalty properties include producing and nonproducing mineral, royalty, overriding royalty, net profits, and leasehold interests in 594 counties and parishes in 28 states; and net profits interests represent net profits overriding royalty interests in various properties owned by the operating partnership. Dorchester Minerals Management LP serves as the general partner of Dorchester Minerals, L.P. The company was founded in 1982 and is based in Dallas, Texas.', 'Dallas, TX, United States', 27);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVOK', 'STOCK', 'Evoke Pharma, Inc.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Evoke Pharma, Inc. is a specialty pharmaceutical company focused on the development and commercialization of drugs to treat gastrointestinal disorders and diseases. It develops, commercializes and markets GIMOTI, a nasal spray formulation of metoclopramide, for the relief of symptoms associated with acute and recurrent diabetic gastroparesis in adults. Gimoti is a dopamine antagonist / mixed 5-HT3 antagonist / 5-HT4 agonist with pro-motility and anti-emetic effects, for the relief of symptoms associated with acute and recurrent diabetic gastroparesis. Gimoti offers systemic delivery by nasal spray administration. It has developed a nasal formulation of metoclopramide to provide its targeted patient population with recurrent symptoms of diabetic gastroparesis with a product that is systemically delivered as an alternative to the oral or intravenous routes of administration. The nasal formulation delivers metoclopramide to patients with delayed gastric emptying and/or frequent vomiting.', 'Solana Beach, CA, United States', 3);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AOSL', 'STOCK', 'Alpha and Omega Semiconductor Limited', 'NMS', 'Technology', 'Semiconductors', 'Alpha and Omega Semiconductor Limited is a designer, developer and global supplier of a broad portfolio of power semiconductors. Its portfolio of products targets high-volume applications, including personal computers, graphic cards, game consoles, flat panel televisions (TV), home appliances, power tools, smart phones, battery packs, consumer and industrial motor controls and power supplies for TVs, computers, servers and telecommunications equipment. Its product portfolio consists of two categories: power discrete and power ICs that serve the large and diverse analog market for power semiconductors. Its power discrete products consist of low, medium and high voltage power MOSFETs. Its power ICs deliver power and control and regulate the power management variables, such as the flow of current and level of voltage. Its portfolio of power semiconductors includes approximately 2,700 products. It conducts its operations in the United States of America, Hong Kong, China, and South Korea.', 'Sunnyvale, CA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATXS', 'STOCK', 'Astria Therapeutics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Astria Therapeutics, Inc. is a biopharmaceutical company focused on the discovery, development and commercialization of novel therapeutics for allergic and immunological diseases. Its lead product candidate is Navenibart, a potential monoclonal antibody inhibitor of plasma kallikrein in clinical development for the treatment of hereditary angioedema (HAE), a rare, autosomal dominant genetic disorder. Its second product candidate is STAR-0310, a monoclonal antibody OX40 antagonist that is in clinical development for the treatment of atopic dermatitis (AD), an immune disorder associated with loss of skin barrier function and itching. It owns five patent families directed to navenibart. The first patent family is directed to the composition of matter of navenibart and its use in treating various plasma kallikrein associated disorders, including HAE. In the second patent family, it is directed to methods of treating various plasma-kallikrein-associated disorders, including HAE.', 'Boston, MA, United States', 78);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EBF', 'STOCK', 'Ennis, Inc.', 'NYQ', 'Industrials', 'Business Equipment & Supplies', 'Ennis, Inc. is a provider of business forms, pressure-seal forms, labels, tags, envelopes, and presentation folders to independent distributors in the United States. The Company is engaged in the business of manufacturing, designing and selling business forms and other printed business products primarily to distributors located in the United States. It manufactures and sells business forms, other printed business products, printed and electronic media, integrated forms and labels, presentation products, flex-o-graphic printing, advertising specialties, internal bank forms, plastic cards, secure and negotiable documents, specialty packaging, direct mail, envelopes, tags and labels and other custom products. It sells its products under various labels: Ennis, Royal Business Forms, Block Graphics, ColorWorx, Enfusion, Uncompromised Check Solutions, VersaSeal, Ad Concepts, FormSource Limited, Star Award Ribbon Company, Witt Printing, Genforms, PrintGraphics, and others.', 'Midlothian, TX, United States', 1856);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AWRE', 'STOCK', 'Aware, Inc.', 'NGM', 'Technology', 'Software - Application', 'Aware, Inc. is a biometric identification company that validates and secures identities using biometrics. The Companys software offerings address the growing challenges that government and commercial enterprises face in knowing, authenticating and securing individuals through frictionless and secure user experiences. Its portfolio enables government agencies and commercial entities to enroll, identify, authenticate, and enable using biometrics, which comprise physiological characteristics, such as fingerprints, faces, irises and voices. Its portfolio of biometric solutions is based on advanced, robust products designed explicitly for ease of integration, including customer-managed and integration ready biometric frameworks, platforms, software development kits (SDKs) and services. Its platform solutions and services include AwareABIS, Knomi Mobile Framework, AFIX Suite of Products, WebEnroll, AwareID, and others.', 'Burlington, MA, United States', 64);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADUS', 'STOCK', 'Addus HomeCare Corporation', 'NMS', 'Healthcare', 'Medical Care Facilities', 'Addus HomeCare Corporation is engaged in providing home care services. Its segments include Personal Care, Hospice, and Home Health. The Personal Care segment provides non-medical assistance with activities of daily living, to persons who are at increased risk of hospitalization or institutionalization, such as the elderly, chronically ill or disabled. The services it provides include assistance with bathing, grooming, feeding and dressing, medication reminders and others. The Hospice segment provides physical, emotional and spiritual care for people who are terminally ill and related services for their families. The Hospice services it provides include palliative nursing care, social work, spiritual counseling, homemaker services and bereavement counseling. Its Home Health segment provides services that are medical in nature to individuals who may require assistance during an illness or after hospitalization and includes skilled nursing and physical, occupational and speech therapy.', 'Frisco, TX, United States', 6165);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BMRC', 'STOCK', 'Bank of Marin Bancorp', 'NCM', 'Financial Services', 'Banks - Regional', 'Bank of Marin Bancorp is a holding company for Bank of Marin (the Bank). The Bank offers a suite of business and personal financial products and services designed to meet the needs of its customers. Its lending categories include commercial real estate loans, commercial and industrial loans, construction financing, consumer loans and home equity lines of credit. Through third-party vendors, it offers merchant and payroll services, a commercial equipment leasing program and credit cards. Its other products and services include payment solutions (mobile deposit and Zelle) and a wide array of treasury management services. It offers personal and business checking and savings accounts, and a number of time deposit alternatives, including time certificates of deposit, Individual Retirement Accounts (IRAs), Health Savings Accounts (HSA), Certificate of Deposit Account Registry Service (CDARS), Insured Cash Sweep (ICS), and Demand Deposit Marketplace (DDM Sweep) accounts.', 'Novato, CA, United States', 302);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FGI', 'STOCK', 'FGI Industries Ltd.', 'NCM', 'Consumer Cyclical', 'Furnishings, Fixtures & Appliances', 'FGI Industries Ltd. is a global supplier of kitchen and bath products. Its product categories include sanitaryware (primarily toilets, sinks, pedestals, and toilet seats), bath furniture (vanities, mirrors and cabinets), shower systems, customer kitchen cabinetry and other accessory items. These products are sold primarily for repair and remodel activity and, to a lesser extent, new home or commercial construction. Its main owned brands in the sanitaryware category include Foremost and contrac. It sells its bath furniture products under the Foremost brand. Its shower systems category products are sold as private label or under its Craft + Main and Jetcoat brands. Its other category includes several smaller categories, most prominently custom kitchen cabinetry brand under its Covered Bridge Cabinetry and Craft + Main Cabinetry lines of products. It sells its products through numerous partners, including mass retail centers, wholesale and commercial distributors, and online retailers.', 'East Hanover, NJ, United States', 420);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACIC', 'STOCK', 'American Coastal Insurance Corporation', 'NCM', 'Financial Services', 'Insurance - Property & Casualty', 'American Coastal Insurance Corporation is the holding company of the insurance carrier, American Coastal Insurance Company. The Company is focused on underwriting commercial residential property insurance. Its other subsidiaries include United Insurance Management, L.C. (UIM), a managing general agent; Skyway Claims Services, LLC (SCS), which provides claims adjusting services to its insurance companies; AmCo Holding Company, LLC (AmCo) which is a holding company subsidiary that consolidates its respective insurance company; BlueLine Cayman Holdings (BlueLine), which reinsures portfolios of excess and surplus policies; Shoreline Re, which provides a portion of the reinsurance protection purchased by its insurance subsidiaries when prudent; Skyway Reinsurance Services, LLC, which provides reinsurance brokerage services for its insurance companies, and Skyway Legal Services, LLC (SLS), which provides claims litigation services to its insurance companies.', 'Saint Petersburg, FL, United States', 65);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSJT', 'STOCK', 'Invesco BulletShares 2029 High Yield Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated high yield corporate bonds (commonly known as “junk bonds”) with maturities or, in some cases, “effective maturities” in the year 2029 (collectively, “2029 Bonds”).', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBU', 'STOCK', 'Community Financial System, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Community Financial System, Inc. is a diversified financial services company that is focused on four main business lines, such as banking, employee benefit services, insurance services and wealth management services. The Companys banking subsidiary, Community Bank, N.A. (CBNA), operates approximately 200 customer facilities across Upstate New York, Northeastern Pennsylvania, Vermont, and Western Massachusetts. CBNA provides a wide array of lending and depository-related products and services. The Companys Benefit Plans Administrative Services, Inc. subsidiary is a provider of employee benefits administration, trust services, collective investment fund administration, and actuarial consulting services to customers on a national scale. The Companys OneGroup NY, Inc. subsidiary is a United States insurance agency. The Company also offers comprehensive financial planning, trust administration and wealth management services through its Wealth Management operating unit.', 'Dewitt, NY, United States', 2730);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLFD', 'STOCK', 'Clearfield, Inc.', 'NGM', 'Technology', 'Communication Equipment', 'Clearfield, Inc. designs, manufactures, and distributes fiber protection, fiber management, and fiber delivery solutions to enable fiber-fed deployment throughout the broadband service provider space primarily across North America. The Companys segments include Clearfield Operating (Clearfield) and Nestor Cables (Nestor Cables). Clearfield is focused on providing fiber management, fiber protection, and fiber delivery products that accelerate the turn-up of fiber-based networks in residential homes, businesses, and network infrastructure in the wireline and wireless access network. Nestor Cables manufactures fiber optic and copper telecommunication cables and equipment which it distributes to telecommunication operators, network owners, electric companies, building contractors, and industrial companies. Nestor Cables customer base includes telecom operators, network owners, contractors, industries and wholesalers. Products are sold via distributors and directly to end users.', 'Minneapolis, MN, United States', 400);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBAT', 'STOCK', 'CBAK Energy Technology, Inc.', 'NCM', 'Industrials', 'Electrical Equipment & Parts', 'CBAK Energy Technology Inc is a China-based investment holding company. The Company primarily operates through two segments. The CBAK''s segment mainly includes the manufacture, commercialization and distribution of a wide variety of standard and customized lithium ion rechargeable batteries for use in a wide array of applications. The Hitrans'' segment mainly includes the development and manufacturing of NCM precursor and cathode materials. The Company''s products are sold to packing plants operated by third parties primarily for use in mobile phones and other electronic devices. Its products are used in various applications, including electric vehicles (EV), such as electric cars, electric buses, hybrid electric cars and buses and light electric vehicles (LEV), such as electric bicycles, electric motors and sight-seeing cars, and electric tools, energy storage, uninterruptible power supply (UPS), and other high power applications.', 'Dalian, , China', 1463);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEAG', 'STOCK', 'Bold Eagle Acquisition Corp.', 'NGM', 'Financial Services', 'Shell Companies', 'Bold Eagle Acquisition Corp. is a blank check company. The Company is formed for the purpose of effecting a merger, share exchange, asset acquisition, share purchase, reorganization or similar business combination with one or more businesses. The Company is neither engaged in any operations nor generated any revenue.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MMU', 'STOCK', 'Western Asset Managed Municipals Fund Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Western Asset Managed Municipals Fund Inc. is a closed ended fixed income mutual fund launched and managed by Legg Mason Partners Fund Advisor, LLC. The fund is co-managed by Western Asset Management Company. It invests in the fixed income markets of the United States. The fund invests in securities that provide income exempt from federal income tax. It invests primarily in investment grade municipal securities. The fund employs intensive proprietary research to create its portfolio. It benchmarks the performance of its portfolio against the Barclays Capital Municipal Bond Index. The fund was formerly known as Managed Municipals Portfolio Inc. Western Asset Managed Municipals Fund Inc. was formed on June 26, 1992 and is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BAOS', 'STOCK', 'Baosheng Media Group Holdings Limited', 'NCM', 'Communication Services', 'Advertising Agencies', 'Baosheng Media Group Holdings Ltd is a holding company principally providing online marketing solutions. The Company advises advertisers on online marketing strategies, offers value-added advertising optimization services and facilitates the deployment of online ads of various forms such as search ads, in-feed ads, mobile app ads and social media marketing ads. The Company also helps online media procure advertisers to buy their ad inventory and facilitate ad deployment on their advertising channels. The Company offers two types of advertising services, search engine marketing (SEM) services and Non-SEM services. Its SEM services include the deployment of ranked search ads and other display search ads offered by search engine operators. Its Non-SEM services include social media marketing, in-feed advertising, and mobile app advertising through deploying ads on media such as social media platforms, short-video platforms, news portals and mobile apps.', 'Shijingshan, , China', 31);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKT', 'STOCK', 'BlackRock Income Trust, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Income Trust, Inc. is a closed ended fixed income mutual fund launched by BlackRock, Inc. The fund is managed by BlackRock Advisors, LLC. It invests in the fixed income markets of the United States. The fund invests in securities of companies that operate across diversified sectors. It invests in securities such as U.S. government sponsored agency securities, non-agency mortgage-backed securities, asset-backed securities, and U.S. treasury obligations. The fund invests its assets in securities that are issued or guaranteed by the US government or one of its agencies or instrumentalities or rated at the time of investment either AAA by S&P or Aaa by Moody''s. BlackRock Income Trust, Inc. was formed on July 22, 1988 and is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCBP', 'STOCK', 'BCB Bancorp, Inc.', 'NGM', 'Financial Services', 'Banks - Regional', 'BCB Bancorp, Inc. is the holding company parent of BCB Community Bank (the Bank). The Bank offers loans, including commercial and multifamily real estate loans, one-to-four family mortgage loans, commercial business loans, construction loans, home equity loans, and consumer loans. The Bank offers deposit products, including savings and club accounts, interest and non-interest-bearing demand accounts, money market accounts, certificates of deposit, and individual retirement accounts; and retail and commercial banking services, including wire transfers, money orders, safe deposit boxes, night depository, debit cards, online banking, mobile banking, fraud detection (positive pay), and automated teller services. The Bank operates about 23 branches in Bayonne, Edison, Hoboken, Fairfield, Holmdel, Jersey City, Lyndhurst, Maplewood, Monroe Township, Newark, Parsippany, Plainsboro, River Edge, Rutherford, South Orange, Union, and Woodbridge, New Jersey, among others.', 'Bayonne, NJ, United States', 264);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APDN', 'STOCK', 'Applied DNA Sciences, Inc.', 'NCM', 'Healthcare', 'Diagnostics & Research', 'Applied DNA Sciences, Inc. is a biotechnology company. The Company is engaged in developing and commercializing technologies to produce and detect deoxyribonucleic acid (DNA) and ribonucleic acid (RNA). The Company operates through three segments: Therapeutic DNA Production Services, MDx Testing Services, and DNA Tagging and Security Products and Services. Therapeutic DNA Production Services segment operations consist of the enzymatic manufacture of synthetic DNA for use in the production of nucleic acid-based therapeutics and, the development and sale of a proprietary RNAP for use in the production of messenger RNA (mRNA) therapeutics. MDx Testing Service segment operations consist of performing and developing clinical molecular diagnostic and genetic tests and clinical laboratory testing services. DNA Tagging and Security Products and Services segment operations consist of the manufacture and detection of DNA for industrial supply chains and security services.', 'Stony Brook, NY, United States', 46);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMWL', 'STOCK', 'American Well Corporation', 'NYQ', 'Healthcare', 'Health Information Services', 'American Well Corporation operates a hybrid care, delivery enablement platform in the United States and globally, connecting and enabling providers, payers, patients, and innovators to deliver access to more affordable quality care. It offers a single, comprehensive platform to support all digital health needs from urgent to acute and post-acute care, as well as chronic care management and healthy living. The Amwell Converge platform offers data architecture and video capabilities, flexibility and scalability, as well as a user experience focused on the needs of patients, members and providers. For health systems, its enterprise platform enables provider-to-provider virtual care for use cases ranging from stroke to virtual nursing and e-sitting. Its Amwell Carepoint devices enable healthcare providers to leverage proprietary carts and transform existing tablets and TVs into digital access points in clinical settings, helping to address personnel shortages and access limitations.', 'Boston, MA, United States', 877);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLBK', 'STOCK', 'Columbia Financial, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Columbia Financial, Inc. is the holding company of Columbia Bank. Columbia Bank is a federally chartered savings bank in Fair Lawn, New Jersey that operates approximately 68 full-service banking offices and offers traditional financial services to consumers and businesses in its market area. It attracts deposits from the general public and uses those funds to originate a variety of loans, including multifamily and commercial real estate loans, commercial business loans, one-to-four family real estate loans, construction loans, home equity loans and advances, and other consumer loans.', 'Fair Lawn, NJ, United States', 708);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FC', 'STOCK', 'Franklin Covey Co.', 'NYQ', 'Consumer Defensive', 'Education & Training Services', 'Franklin Covey Co. is a global content and solutions company focused on individual and organizational performance improvement. The Company provides professional services in 150 countries and territories around the world. Its segments include North America, International Direct Offices, International Licenses, Education Practice, and Corporate and Other. The North America segment offers organizations to solve the problems that require changes in human behavior, including leadership, productivity, execution, trust, and sales performance. This segment includes sales personnel and operations that serve the United States and Canada. The International Licensees segment is primarily comprised of its international licensees royalty revenues. The Education Practice segment includes its domestic and international education practice operations. The Corporate and other information includes leasing operations, shipping and handling revenues, royalty revenues from Franklin Planner Corp.', 'Salt Lake City, UT, United States', 1084);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CQP', 'STOCK', 'Cheniere Energy Partners, L.P.', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'Cheniere Energy Partners, L.P., through its subsidiaries, provides liquefied natural gas (LNG) to integrated energy companies, utilities, and energy trading companies in the United States and internationally. The company owns and operates natural gas liquefaction and export facility at the Sabine Pass LNG Terminal located in Cameron Parish, Louisiana. It also owns a natural gas supply pipeline that interconnects the Sabine Pass LNG terminal with various interstate and intrastate pipelines. Cheniere Energy Partners, L.P. was founded in 2003 and is headquartered in Houston, Texas. Cheniere Energy Partners, L.P. is a subsidiary of Cheniere Energy, Inc.', 'Houston, TX, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELBM', 'STOCK', 'Electra Battery Materials Corporation', 'NCM', 'Basic Materials', 'Other Industrial Metals & Mining', 'Electra Battery Materials Corporation is a Canada-based company. It is in the business of producing battery materials for the electric vehicle supply chain. It is focused on building a supply of cobalt, nickel and recycled battery materials. Its segment includes refinery, exploration and evaluation assets, and corporate and other. In addition to establishing the cobalt sulfate refinery, it is engaged in nickel refining and battery recycling. Its growth projects include integrating black mass recycling at its existing refining complex, evaluating opportunities for cobalt production in Becancour, Quebec, and exploring nickel sulfate production potential in North America. Its refinery process provides automakers with a circular solution to recycle their batteries and to source new batteries for new electric vehicles. Its Iron Creek Project consists of mining patents and exploration claims over an area of 3,300 hectares covering the strike extent of strata hosting mineralization.', 'Toronto, ON, Canada', 23);\n
